    /// <summary>
    /// Unit tests for the Fast Fourier Transform methods
    /// </summary>
    /// <remarks>
    ///     <b> Authors: </b>
    ///     Haden Smith, USACE Risk Management Center, cole.h.smith@usace.army.mil
    /// </remarks>
    [TestClass]
    public class Test_FastFourierTransform
    {
        /// <summary>
        /// Test Fast Fourier Transform.
        /// </summary>
        [TestMethod()]
        public void Test_FFT()
        {
            var complex = new[] { 0d, 0d, 1d, 0d, 2d, 0d, 3d, 0d, 4d, 0d, 5d, 0d, 6d, 0d, 7d, 0d };
            // ^ every other value is imaginary of 0.0
            Fourier.FFT(complex);
            var true_complex = new[] { 28.0d, 0.0d, -4.0d, -9.6569d, -4.0d, -4.0d, -4.0d, -1.6569d, -4.0d, 0.0d, -4.0d, 1.6569d, -4.0d, 4.0d, -4.0d, 9.6569d };
            // ^ Every other value of output is imaginary
            // 28.0000 - 0.0000i
            // -4.0000 - 9.6569i
            // -4.0000 - 4.0000i
            // -4.0000 - 1.6569i
            // -4.0000 + 0.0000i
            // -4.0000 + 1.6569i
            // -4.0000 + 4.0000i
            // -4.0000 + 9.6569i
            // Validate FFT
            for (int i = 0; i < complex.Length; i++)
                Assert.AreEqual(complex[i], true_complex[i], 0.0001d);
        }

        /// <summary>
        /// Test Fast Fourier Transform.
        /// </summary>
        [TestMethod()]
        public void Test_RealFFT()
        {
            var real = new[] { 0d, 1d, 2d, 3d, 4d, 5d, 6d, 7d };
            Fourier.RealFFT(real);
            // Returns the first and last real values as [0] and [1] respectively. 
            // Only return the first half of the complex array
            var true_real = new[] { 28.0d, -4.0d, -4.0d, -9.6569d, -4.0d, -4.0d, -4.0d, -1.6569d };
            // ^ Every other value of output is imaginary
            // 28.0000 - 4.0000i
            // -4.0000 - 9.6569i
            // -4.0000 - 4.0000i
            // -4.0000 - 1.6569i
            // Validate FFT
            for (int i = 0; i < real.Length; i++)
                Assert.AreEqual(real[i], true_real[i], 0.0001d);
        }

